DualCompare_1.query:
q = load "${App.Datasets.HealthCloud_RiskStratification_tp.FullyQualifiedName}";
q=filter q by 'ProgramPatientSummary_MostRecent' == "true";
q=filter q by 'ProgramPatientSummary_EnrollmentType' == "Dual";
q=filter q by 'ProgramPatientSummary_Year' == "{{cell(Current_Prev_Year_1.result, 0, "CurrentYear").asString()}}";
q = group q by all;
q = foreach q generate count() as 'countCurrent';

r = load "${App.Datasets.HealthCloud_RiskStratification_tp.FullyQualifiedName}";
r=filter r by 'ProgramPatientSummary_EnrollmentType' == "Dual";
r=filter r by 'ProgramPatientSummary_MostRecent' == "true";
r=filter r by 'ProgramPatientSummary_Year' == "{{cell(Current_Prev_Year_1.result, 0, "PreviousYear").asString()}}";
r = group r by all;
r = foreach r generate count() as 'countPrev';
s=cogroup q by all,r by all;
s=foreach s generate ((sum(q.'countCurrent')-sum(r.'countPrev'))/sum(r.'countPrev')) as 'sum_percent',(case when ((sum(q.'countCurrent')-sum(r.'countPrev'))/sum(r.'countPrev')) <0 then "#DC0029" when ((sum(q.'countCurrent')-sum(r.'countPrev'))/sum(r.'countPrev')) >=0 then "#26AB40" else "#32b181" end) as 'color';

